import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom';


function AdminPage({isLoggedIn}) {

  const navigate = useNavigate();



  useEffect(() => {
    if (!isLoggedIn){
      navigate("/login");
      console.log(isLoggedIn)
    }
  }, []);




  return (
    <div>
      <h2>HELLO</h2>
    </div>
  );
}

export default AdminPage;
